import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { Ionicons } from "@expo/vector-icons";

import FriendDirectory from "./FriendDirectory";
import GroupDirectory from "./GroupDirectory";
import QA from "./QA";

const Tab = createBottomTabNavigator();

const DirectoryComponents = () => {
  return (
    <Tab.Navigator
      initialRouteName="ChatList"
      screenOptions={({ route }) => ({
        tabBarIcon: ({ focused, color, size }) => {
          
          if (route.name === "FriendDirectory") {
            iconName = focused
              ? "chatbubble-ellipses"
              : "chatbubble-ellipses-outline";
          } else if (route.name === "GroupDirectory") {
            iconName = focused ? "people" : "people-outline";
          } else if (route.name === "QA") {
            iconName = focused ? "compass" : "compass-outline";
          } 
          return <Ionicons name={iconName} size={size} color={color} />;
        },
      })}
    >
      <Tab.Screen name="FriendDirectory" component={FriendDirectory} />
      <Tab.Screen name="GroupDirectory" component={GroupDirectory} />
      <Tab.Screen name="QA" component={QA} />
    </Tab.Navigator>
  );
};

export default DirectoryComponents;
